oxy_webhelp_navlinks = {"pause_and_resume_for_sla_domains-d22872e4674":{"topics":[{"title":"Pausing SLA Domain protection","shortdesc":"<p class=\"shortdesc\">To temporarily stop protection for specific objects in a Rubrik cluster, pause the         protection activity of the SLA Domain that protects those objects. This action only pauses         the protection activity for the objects under that SLA Domain, while other objects in the         cluster protected by different SLA Domains remain unaffected.<\/p>","href":"saas\/pausing_sla_domain_protection.html","attributes":{"data-id":"pausing_sla_domain_protection"},"menu":{"hasChildren":false},"tocID":"pausing_sla_domain_protection-d22872e4685","topics":[]},{"title":"Resuming SLA Domain protection","shortdesc":"<p class=\"shortdesc\">Resume protection activity for a paused SLA Domain for all the objects on the Rubrik         cluster which are protected by the SLA Domain.<\/p>","href":"saas\/resuming_sla_domain_protection.html","attributes":{"data-id":"resuming_sla_domain_protection"},"menu":{"hasChildren":false},"tocID":"resuming_sla_domain_protection-d22872e4696","topics":[]}]}};